repeat 
if tyms > 70 and (ming == 0.001 or ming == -2.5) then ming = -2.5
local bpos = (bullet.CFrame *cf(0,0,-300)).p if (bpos - v3(Palm.Position.x,bpos.y,Palm.Position.z)).magnitude < 25*s then ming = 0 end 
end
tyms = tyms + 2
