		lh.C0 = lh.C0:Lerp(lhc0 * cf(0,0,0) * angles(rad(0),rad(5),rad(-2.5)),alpha)
		alpha = alpha + add
		swait()
	end
	local s = script.Models.Syringe:Clone()
