		Torso.song.PlaybackSpeed = 1
	elseif(io.KeyCode == Enum.KeyCode.Seven and Mode~='Troubadour')then 
		changeMode'Troubadour'
		Torso.song.PlaybackSpeed = 1
	elseif(io.KeyCode == Enum.KeyCode.Eight and Mode~='Legendary')then 
