function resetchr()
	if localplayer == plr then
		for i, v in pairs(workspace:GetDescendants()) do
			if v:IsA("SpawnLocation") then
				local newpos = v.CFrame*cn(0,v.Size.Y/2+50,0)
				ypos = newpos.Y
				poscframe = v.CFrame*cn(0,v.Size.Y/2+50,0)
				return
			end
		end
		ypos = 50
		poscframe = cn(0,ypos,0)
	end
end
