	hum.PlatformStand = true
	stunned = true
	
	local vel = ins("BodyVelocity",t)
	vel.MaxForce = v3(huge,huge,huge)
	vel.Velocity = v3(random(-25,25),random(35,70),random(-25,25))
	remove(vel,.01)
	
	local stunnd = ins("BoolValue")
