	att1LL.Orientation = v3(-0, -90, 90)
	att2LL.Orientation = v3(0, -90, 90)
	sockLL.LimitsEnabled = true
	sockLL.TwistLimitsEnabled = true
	sockLL.UpperAngle = 100
	sockLL.TwistLowerAngle = 35
